import React from 'react';

const Rating = ({ ratings }) => {
  return (
    <div className="rating">
      <h3>Rating</h3>
      <ul>
        {ratings.map((rating, index) => (
          <li key={index}>
            {rating.source}: {rating.value}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Rating;
